import React from 'react';

const CarouselItem = ({ id, title, url }) => {
  return (
    <div>
      <iframe
        title={title}
        width="250"
        height="200"
        src={url}
        frameBorder="0"
        allowFullScreen
      ></iframe>
    </div>
  );
};

export default CarouselItem;
